const Mapfunction = () => {
  const Data = [
    {
      id: 1,
      name: 'Ankit',
    },
    {
      id: 2,
      name: 'Anmol',
    },
    {
      id: 3,
      name: 'Prachi',
    },
  ];
  return (
    <div>
      {Data.map (Mapfunction => <div>{Mapfunction.name}</div>)}
    </div>
  );
};

export default Mapfunction;
